met Brendan Fraser, Harrison Ford en Keri Russell

John en Aileen Crowley hebben drie kinderen. De twee jongste, Megan en Patrick, hebben de ziekte van Pompe. Een erfelijke en 
aangeboren stofwisselingsziekte. De kinderen lijkt een kort leven beschoren, totdat John in contact komt met de wetenschapper 
Dr. Robert Stonehill (Harrison Ford). Samen met hem begint hij een race tegen de klok, de ontwikkeling van een behandeling om 
de ziekte te kunnen genezen.
